import React from "react";
import styles from "./Ranking.module.css";
import Header from "../components/Home/Header";

// Images
import RankingHeader from "../assets/ranking.png";
import down from "../assets/Ranking/down.png";

const Ranking = () => {
  return (
    <div className={styles.RankingContainer}>
      <Header />
      {/* <img src={RankingHeader} className={styles.RankingHeader} /> */}
      <div>
        <span>LCK 순위</span>
        <span>좋아하는 팀의 순위를 확인해보세요!</span>
      </div>
      <div>
        <div>
          <span>2024 LCK 서머</span>
          <img src={down} className={styles.downImg} />
        </div>
      </div>
    </div>
  );
};

export default Ranking;
